import React from "react";
import {Link} from "react-router-dom";

function Index() {
  return (
    <ul>
      <li>
        <Link href="./Hooks/useStateEx.js">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About Us</a>
        </Link>
      </li>
    </ul>
  );
}

export default Index;
